import Box from "@mui/material/Box";
import "./ShowBox.css";
import { useState } from "react";

const ShowBox = () => {
  const [side, siedChage] = useState("left");

  return (
    <>
      <Box
        className="Round-box-right"
        sx={{
          width: "auto",
          maxWidth: "600px",
          height: "100px",
          alignItems: "center",
          backgroundColor: "white",
          margin: "left",
        }}
      >
        hello
      </Box>
      <Box
        sx={{
          width: "auto",
          height: 500,
          alignItems: "center",
          backgroundColor: "white",
          margin: "auto",
        }}
      ></Box>
    </>
  );
};

export default ShowBox;
